:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  WILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Gertrude Mary Beetham and RUSSELL, Andrew Hamilton
  JRUSSELL, Margaret Gertrude (Margot) and LOWRY, Thomas Coleman (Tom)
  VLOWRY, Thomas Russell (Tom) and de GRUCHY, Margaret Jane
  02> LOWRY, Thomas Russell (Tom) m on 22.01.1960 to de GRUCHY, Margaret Jane
  b 13.05.1936
  b 13.05.1938
  Address: Okawa, RD, Fernhill, Hastings.
  Tom is a farmer and thoroughbred breeder. Three Legs, one of his stallions, was champion sire over
  three years. He has been President of the Hawkes Bay Jockey Club and is a member of the Racing
  Conference. Jane's interests include dramatics and gardening.
  01> LOWRY, Caroline Jane
  b 10.10.1961
  Caroline lives at Okawa. She has been working in television and as a salesperson for Susan Paul.
  02> LOWRY, Georgina Catherine m on 12.12.1992 to MASON, Martin Gilbert
  b 23.02.1964
  b ** ** ****
  Georgina m, at Okawa. Martin, s/o Bernard Gilbert Mason and Nancy Hotene, b. at Te Puke. Address:
  4 Kilmister Street, Avalon, Lower Hutt.
  Georgina is an artist and a nanny and Gilbert is a fitter and turner. To both of them, their .
  Christian faith is very important.
  03> LOWRY, Alessandra Mary m on 12.02.1988 to WYNNE - LEWIS, Richard Eric
  (Sana)
  b 21.09.1965
  b 12.02.1963
  Richard, s/o David Canning Wynne-Lewis and Shirley Anne Todd. Address: RD 4, Waipukurau.
  Descendants and biographies of Sana and Richard are included under Richard's entry in this Family
  Tree.
  > LOWRY, Thomas Graham William
  b 16.12.1969
  Tom is managing Okawa.
  03> LOWRY, Edward Patrick m on 12.11.1965 to HEWITT, Jane Mary
  b 17.06.1939
  b 27.10.1940
  Edward b. at Hastings and m, at St John's Church, Trentham. Jane, d/o TB Hewitt and Betty Stuart
  Wilson, b. at Wellington. Address: Kiwitahi, RD 1, Taupo.
  Pat is a farmer and has been involved in breeding racehorses and also running a romney. stud. He is
  master of the Taupo Hunt and President of the Taupo Racing Club.
  01> LOWRY, Patrick Henry
  b 16.03.1968
  Patrick attended Huntley School and Christ's College then graduated BAgCom from Lincoln University.
  He spent four years overseas and now manages "Kiwitahi". His interests include trout fishing and
  power boat racing.
  02> LOWRY, Edward Guy
  b 24.05.1970
  Guy attended Huntley School and Christ's College and then Marcus Oldham College in Geelong,
  Victoria, specialising in thoroughbreds. He has been involved in horse breeding in Australia and
  in Ireland and the USA. He then trained horses and was stable foreman in Melbourne. At present he
  is working as a trainer in Hastings.
  03> LOWRY, Kate Margot
  b 06.07.1971
  Kate attended Woodford House and completed a cordon bleu course in London. She is now working in
  wine promotion at the Montana outlet in Church Road, Taradale.
